import React from 'react';
import {Box, Button, Flex, Grid, GridItem, Heading, Text} from "@chakra-ui/react";
import {ArrowBackIcon} from "@chakra-ui/icons";

const CreateQuestionPage = () => {
    return (
        <Box bg={'#F7FAFC'} minH={'100vh'}>
            <Flex direction={'column'}>
                {/*Header*/}
                <Box minH={'60px'} maxH={'80px'} bg={'teal.600'}>
                    <Flex alignItems={'center'} justifyContent={'space-between'} p={4}>
                        <ArrowBackIcon fontSize={35}/>
                        <Text>Editted 1 minute ago</Text>
                        <Button>Publish</Button>
                    </Flex>
                </Box>
                {/*    Content*/}
                <Box>
                    <Grid
                        bg={'white'}
                        // h="200px"
                        templateRows="repeat(3, 1fr)"
                        templateColumns="repeat(3, 1fr)"
                        gap={4}
                    >
                        <GridItem>
                            <Box width={'50px'} height={'50px'}>sd</Box>
                        </GridItem>
                    </Grid>
                </Box>
            </Flex>
        </Box>
    );
};

export default CreateQuestionPage;
